import React from "react";
import board from "./../images/board.png"

class Info extends React.Component
{
    clicked()
    {
        console.assert(true, "Clicked");
        return(
            <div className="Clicked">
                It was clicked!!!
            </div>
        );
    }

    render()
    {
        return(
            <div className="Info">
                <button onClick={this.clicked} />
            </div>
        );
    }
}

export default Info;
